import classess from "./Header.module.css";
import React from "react";
import mealsImage from "../../Assets/meals.jpg";
function Header() {
  return (
    <React.Fragment>
      <header className={classess.Header}>
        <h1>React Meals</h1>
      </header>
      <button>Cart</button>
      <div className={classess['main-image']}> // Since class name contain -, we can't use clasess.className
        <img src={mealsImage} alt="A table full of delious food"></img>
      </div>
    </React.Fragment>
  );
}

export default Header;
